import React from 'react';
import { Link } from "react-router-dom";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import './App.css';
import StoreModel from './model_more/model';
import HomeView from './site_pages/home.js';

import ProductView from './site_pages/products.js';
import LinkHandlerCategorys from './site_pages/linkhandlerCategory.js';
import LinkHandlerSubcategorys from './site_pages/linkhandlerSubcategory.js'
import Header from './header_footer/header.js';
import Footer from './header_footer/footer.js';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.model = new StoreModel;
    this.state = {
      value: ""
    };
  }
    handleChange = (event) => {
      this.setState({
        value: event.target.value,
      });
  }

  render() {
    return (<Router>
          <React.Fragment>
            <Switch>

              <Route
                path="/"
                exact
                component={() => <HomeView model={this.model} />}/>

              <Route
                path="/Checkout"
                exact
                component={() => <HomeView model={this.model} />}/>

              <Route
                path="/:category" 
               exact
                component={() => <LinkHandlerCategorys model={this.model} />}/>

              <Route
                path="/:category/:subcatagory" 
                exact
                component={() => <LinkHandlerSubcategorys model={this.model} />}/>

             <Route
                path="/:category/:subcatagory/:product" 
                exact
                component={() => <ProductView model={this.model} />}/>              

              <Route component={NoMatch} />



            </Switch>
          </React.Fragment>
          <Header model={this.model}/>
          <Footer/>
        </Router>

    );
  }
  //<Route path="/specPlaylist" render={() => <playlistSettings model={heroifyModel}/>}/>
}

const NoMatch = () => (
  <div className="pageWrapper">
    <div className="pageTopDivider"></div>
    <div className="text-center">
      <h className="headerPageText" >404 No match</h>
      <Link to="/">
        <h1>Click here to go to homepage</h1>
      </Link>
    </div>
  </div>
);

export default App;
